    // its like dipatch
    const dispatch = useDispatch();
    //Use Selector is like map state to props
    const counter = useSelector(state => state.count);
    return (
        <div className="container" style={{backgroundImage: require('./nefritis.svg') ,width:"1000px",height:"1000px"}}>
            <div style={{backgroundImage: require('./nefritis.svg') ,width:"1000px",height:"1000px"}}>
                Kek
            </div>

            {/*<img src={require("./nefritis.svg")} alt={"kek"}/>*/}
        </div>

    );
};
export default Title;
